import React, { useEffect } from 'react';
import Location from '../components/home-page/Location';
import Search from '../components/home-page/Search';
import Categories from '../components/home-page/Categories';
import EscortContent from '../components/home-page/EscortContent';
import { connect } from 'react-redux';
import { getAllPosts, getLocationsInfo, getNewPosts, selectPostsPage } from '../redux/actions/actions';

function Home({ categories, getAllPosts, posts, getLocationsInfo, states, getNewPosts, newPosts, pagesNumber, selectPostsPage }) {

	useEffect(() => {
		getAllPosts();
		getLocationsInfo();
		getNewPosts();
	}, []);

	return (
		<div>
			<Location states={states} />
			<Search />
			<Categories categories={categories} newPosts={newPosts} />
			<EscortContent posts={posts} pagesNumber={pagesNumber} selectPostsPage={selectPostsPage} />
		</div>
	);
}


const mapStateToProps = state => {
	return {
		...state,
		categories: state.app.categories,
		posts: state.app.posts,
		states: state.app.states,
		newPosts: state.app.newPosts,
		pagesNumber: state.app.pagesNumber
	};
};

const mapDispatchToPops = {
	getAllPosts, getLocationsInfo, getNewPosts, selectPostsPage
}

export default connect(mapStateToProps, mapDispatchToPops)(Home);
